(1, 9, 'quangHai172.png', '42', '10', '2', 'Nguyen Quang Hai (born 12 April 1997) is a Vietnamese professional footballer who plays as an attacking midfielder or winger for French club Pau FC in Ligue 2 and the national team. Vietnam country . He is the player who received the Vietnam Golden Ball award in 2018 and is considered one of the best players in the history of Vietnamese football.', '2017', '2017-12-09', 'Myanmar(A)', 'When I told you a little bit about the vision. The first is that we must make the most of our current resources. The second is to create a strong team in Southeast Asia, gradually forming a strong and competitive team in Asia.', '42', '10', '9');
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(11, 5, 'Thailand received a loss in the final against U23 Vietnam', '<p><strong>Hanoi (VNA)</strong>&nbsp;&ndash; Nham Manh Dung&rsquo;s leaping header in the 83rd minute giving Vietnam the&nbsp;<a href=\"https://en.vietnamplus.vn/tags/SEA-Games-31.vnp\"><strong>SEA Games 31</strong></a>&nbsp;men&#39;s football crown has made headlines on Thailand&rsquo;s media, describing the news as a heartbreak for Thai fans.<br />\r\n<br />\r\nNews site Sports Trueid said the&nbsp;<a href=\"https://en.vietnamplus.vn/tags/Thai-War-Elephants.vnp\"><strong>Thai War Elephants</strong></a>&nbsp;suffered a heartbreaking 0-1 loss to Vietnam and missed the SEA Games gold medal.<br />\r\n<br />\r\nNational daily newspaper Matichon run a story headlined &ldquo;the whole country is in tears, the War Elephants could not fulfill dream, losing 0-1 to Vietnam&rsquo;s U23 team.&rdquo; It reported the developments of the SEA Games men&rsquo;s&nbsp;<a href=\"https://en.vietnamplus.vn/tags/football.vnp\"><strong>football</strong></a>&nbsp;final match, noting that Thailand&rsquo;s team received a painful defeat and they had never thought of losing to Vietnam.<br />\r\n<br />\r\nSMM Sport highlighted Nham Manh Dung as a hero of the Vietnamese team while Siamrath&rsquo;s article also showed regrets that Thailand could not reach to the championship this year./.</p>', 'Thailand', 'Thailand', 1, 'thailand_team0.jpg', 9, '2022-08-12 19:28:36', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(14, 4, 'Coach Park extends contract with VFF for another year', '<h1><span style=\"font-size:24pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"font-size:22.5pt\"><span style=\"font-family:&quot;notosans-bold&quot;,serif\"><span style=\"color:#2a2a2a\">Coach Park extends contract with VFF for another year</span></span></span></strong></span></span></span></h1>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">Korean coach Park Hang-seo has extended his contract with the Vietnam Football Federation (VFF) for another year, from February 1, 2022 to January 31, 2023.</span></span></span></strong></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"620\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:10.5pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnam head coach Park Hang-seo. (Photo: VFF)</span></span></span></span></em></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">To enable Park to focus on his training tasks with Vietnam&#39;s national squad, the VFF plans to make some changes to coaching positions of U23 team. After Park completes his job at the 31st Southeast Asian Games (SEA Games) slated in May 2022, he will become a manager of the U23 team and its head coach position will be handed over to another person appointed by the VFF.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">This move will ease Park&rsquo;s workload and pressure to enable him to perform better as the head coach of the national team in the coming time, according to the VFF.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Park was born on January 4, 1959 in Sancheong county in the Republic of Korea&#39;s South Gyeongsang province.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">He was a national team player before working as a professional coach. He used to work at the training centres of Palmeiras Club in Brazil and Bayer Leverkusen of Germany.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Park was an assistant to Guus Hiddink, coach of the Korean national team who entered the semi-finals at World Cup 2002.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">He first came to Vietnam in October 2017 under a two-year contract and has achieved great successes. Under the guidance of Park, Vietnam secured the fourth position at the Asian Games 2018, second place at the AFC U23 Championship 2018 and won the AFF Championship - Suzuki Cup 2018. The team also won the title at the 30th SEA Games in 2019.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Park has four important tasks ahead. The national team are expected to go as far as possible at the 2022 World Cup&#39;s third qualifiers and the 2022 Asian U23 Championship qualifying round. They will then defend their titles at the 2021 AFF Cup and the 31st SEA Games.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Vietnamese national team will play Japan at My Dinh National Stadium in Hanoi at 7:00pm on November 11</span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>', 'Coach Park U23', 'Coach Park', 1, 'vnp_hlvparkhangseo110.jpg', 7, '2022-09-08 17:57:58', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(15, 4, 'Coach Park extends contract with VFF for another year', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">National team coach Park Hang-seo returned to Vietnam on July 28 from a leave in his hometown to prepare his squads for the two new missions &ndash; the final round of the Asian Qualifiers for the 2022 World Cup&nbsp;and the AFC U23 Asian Cup 2022 Qualifiers.</span></span></span></strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:10.5pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnam head coach Park Hang-seo. (Photo: VFF)</span></span></span></span></em></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Park was joined by two countrymen, doctor Choi Ju-young and goalkeeping trainer Kim Hyu-tae, on the flight back to Vietnam. After entry, they will implement concentrated quarantine at a hotel in Hanoi according to the Ministry of Health&rsquo;s regulations.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">During his leave, Park still kept regular contact and discussed work with the profession department of the Vietnam Football Federation (VFF) as well as members of the coaching staff in order to finalise preparation plans for the two aforementioned campaigns.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Republic of Korean tactician has proposed a list of 31 players to be called up to the national team and another list of 30 names summoned for the Vietnam U22 team.</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Coach Park Hang-seo has decided to call up 31 players to the Vietnamese national team for their upcoming training camp. (Photo: VFF)</span></span></span></em></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">If nothing changes, the national team will reconvene this August 5, with the U22 squad set for five days later. To ensure the quality of professional work, Park has assigned specific tasks to his assistants in the coaching staff. Accordingly, assistant coach Lee Young-jin and a team of Vietnamese assistants will support Park&rsquo;s work at the national team, while assistant Kim Han-yoon will coordinate with other members in the coaching staff to take charge of affairs at Vietnam U22s.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Currently, the VFF is carrying out the necessary procedures to enable the two teams to keep with the set reconvening schedule, while developing COVID-19 prevention and control plans to ensure the quality and effectiveness of the training camps.</span></span></span></p>', 'Coach Park U23 VN', 'Coach Park  U23 VN', 1, 'football-coach-park-hang-seo-returns-to-vietnam-to-prepare-for-new-missions11.jpg', 2, '2022-09-08 18:05:21', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(16, 5, 'AFF U23 Championship – The extraordinary journey of U23 Vietnam', '<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">Behind the victories of U23 Vietnam in Phnom Penh, it is not only the professional factor but also an unprecedented and inspirational story.</span></span></span></strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">A few hours after the victory of 13 Vietnamese U23 players over U23 Timor Leste in the semi-final of the 2022 AFF U23 Championship in Cambodia, a picture of a meal box for Coach Dinh The Nam and his players at the hotel was shared&nbsp;on the social networks and received many compassionate comments. Despite falling into adversity, U23 Vietnam still resiliently stayed on the journey, creating spectacular matches.</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Normally, football players restore their health by buffets of nutritious dishes. However, due to the Covid-19 pandemic, Coach Dinh The Nam and his players were only provided by the organizer with meal boxes of 3-4 dishes to relieve hunger and regenerate energy for the competition density of two days per match in the regional youth playground. With such a diet, Vietnamese players could still run and play for 120 minutes and then compete in the penalty shoot-out. It is really respectable.</span></span></span><br />\r\n<br />\r\n<span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\"><span style=\"background-color:white\">Behind the&nbsp;victories of U23 Vietnam&nbsp;in Phnom Penh, it is not only the professional factor but also an unprecedented and inspirational story.</span><br />\r\n<br />\r\n<span style=\"background-color:white\">The Covid-19 storm left U23 Vietnam with only 16 players for the match against U23 Thailand in the group stage, then only&nbsp;13 to play with Timor Leste in the semi-final. From the group stage, living in cramped rooms with unguaranteed nutritional conditions and concerns over Covid-19, these young players were not afraid of anything. They entered the match with the determination to follow the victories of their seniors in the Vietnamese National Football team and satisfy the beliefs of millions of Vietnamese fans waiting for their victory at home.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:10.5pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The desire for victory is the strength of U23 Vietnam in this tournament. (Photo: SGGP)</span></span></span></span></em></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Coach Dinh The Nam told his players that they would unlikely have the same experience like that a second time, so they must put effort to make memorable memories to tell their children later. So even Dinh Hai and Tan Tai, the additional players, who had spent two hours by air and eight hours by bus earlier, still entered the field full of enthusiasm.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">They did not have time to get acquainted and assemble the formation with their teammates, but just walked into the pitch, listened to the tactical instructions from Mr. Dinh The Nam, and then merged into the mutual playing style of the team unknowingly.<br />\r\n<br />\r\nThe images of Trung Thanh and Quang Thinh suppressed the pain, fell on the grass, and got up again, asking the head coach to continue to play until they could not lift their legs before leaving the field, making the spectators admire them a lot. Perhaps, during his career, goalkeeper Liem Dieu never thought that his position in his first important international match was not at the goal but the top of the attack - the center.&nbsp;</span></span></span></span></span></span></p>\r\n\r\n<table cellspacing=\"0\" class=\"Table\" style=\"background:white; border-collapse:collapse; width:100.0%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:white\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white\">\r\n			<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Covid-19 pandemic still develops unpredictably and will bring more challenges to the next tournaments. Therefore, the experience and valuable lessons from the AFF U23 Championship playground will help the AFF, the tournament organizer, the participants, especially the VFF and the Vietnam team, be more cautious and thorough in preparation for the future.</span></span></span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Covid-19 pandemic might have taken away the health of U23 Vietnam players but could not have defeated the spirit, the will, and the desire to overcome difficulties and rise in adversity to express the talents and qualities of Vietnamese people. Positively speaking, Covid-19 has accidentally brought promising young talents to Vietnam football.</span></span></span></span></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:10.5pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Trung Thanh played like a warrior until he is exhausted in the match against Timor Leste. (Photo: SGGP)</span></span></span></span></em></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">In three matches in Phnom Penh, Coach Dinh The Nam used three different goalkeepers, including Y Eli Nie, Xuan Hoang, and Tuan Hung. All of them played excellently with spectacular saves. With a patched formation, U23 Vietnam&#39;s defense is currently the only team that has not lost a goal. A memorable experience for the players in, perhaps, the most exciting tournament in the history of world football during Covid-19.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Flexible improvisation</span></span></strong><br />\r\n<span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">For the opening tournament of Southeast Asian football in 2022 not to fall into failure, the ASEAN Football Federation (AFF), together with the local organizer and representatives of the teams, had continuously held emergency meetings to handle arising situations, thereby providing solutions suitable to reality. All had agreed that each team could replace up to ten players if there were Covid-19 cases.<br />\r\n<br />\r\nThe Vietnam Football Federation (VFF) and related units had flexibly responded to find ten additional players, who later traveled to Phnom Penh by road and air to help U23 Vietnam have enough players to join the match. Acting VFF President Tran Quoc Tuan also made telephone calls to the AFF President and the Cambodian Football Federation about the commitment of the Vietnam U23 team to never give up. VFF leaders also persuaded the AFF to make the next decision - as long as each team had seven players negative for Covid-19, the final and the third-place matches would be held.<br />\r\n<br />\r\nBesides the effort of VFF and U23 Vietnam, overseas Vietnamese in Cambodia were always ready to support Coach Dinh The Nam and his players. They waited for the additional players at the Moc Bai Border Gate in Tay Ninh Province to take them straight to the team&#39;s hotel. They also assisted the staff in printing the name and number of the substitute goalkeeper Liem Dieu.<br />\r\n<br />\r\nTherefore, Vietnam&#39;s victories in the 2022 AFF U23 Championship have shown good adaptation to the risks of Vietnam football.</span></span></span></span></span></p>', 'AFF U23', 'AFF U23', 1, 'aff-u23-championship-the-extraordinary-journey-of-u23-vietnam37.jpg', 3, '2022-09-08 18:12:48', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(17, 4, 'Sports doctors, the unsung heroes of Vietnam\'s success', '<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">Doctor Duong Tien Can had a high temperature and cough, and a test proved his suspicions - he was a COVID-19 patient.&nbsp;</span></span></span></strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">But Can could not rest for he still had work to do, taking care of the U23 football players who won the AFF Championship title</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:10.5pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Doctor Duong Tien Can (right) takes care of a player during the AFF U23 Championship. Photo of VFF</span></span></span></span></em></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Can was one of two doctors assigned to follow the U23 team. He&nbsp;worked&nbsp;on a range of issues, such as&nbsp;dealing with injured players and helping with recovery after gruelling games. His&nbsp;goal is to get players back in action as quickly and as safely as possible.&nbsp;</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">But on this working trip, apart from his normal duties, Can had to deal with a big problem; the COVID-19 pandemic, which affected many players.&nbsp;</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">&quot;We discussed the matter before we left for Cambodia, but I could not imagine that it would spread so fast among our team,&quot; said Can, whose second son was&nbsp;born a few days ago in Hanoi.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The doctors&#39;&nbsp;day started at 6am when they&nbsp;sanitised the hotel area where the Vietnam team stay. They had to clean the elevator and the stairs that led players from their rooms to the restaurant.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">They kept reminding players to keep a safe distance and suggested foods that are good for their physique.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">They also took charge of doing quick tests for players, once every three days.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">But they could not stop COVID-19 from attacking the team. The first players tested positive on February 17, just a few days after the team landed in Phnom Penh.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The doctors&#39; workload increased. They had to continue their normal duties while carrying out&nbsp;a care programme for the sick members.&nbsp;</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">&quot;It was a really big worry because more cases would come out soon. Our duty was doubled. We had to take care of players on the field, giving them energy drinks, preparing ice packs and giving treatment to players&#39; injuries. Then, we prepared medicine and traditional herbs and food for the patients. We were overloaded with work,&quot; said Can, who&nbsp;himself tested positive 10 days later.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Can however could not rest - almost 30 patients needed him.&nbsp;</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">He was not allowed to work on the field but he took care of players at the hotel and supported his colleague by phone&nbsp;when necessary.</span></span></span></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:10.5pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Doctor Duong Tien Can (first row, second from right) poses for photos with athletes at the 2019 SEA Games in the Philippines.&nbsp;</span></span></span></span></em></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">&quot;It was the most memorable trip. Luckily, we received help and encouragement from the Vietnam Football Federation, Vietnam Anti-Doping Agency, and the team&#39;s coaching board. We were tired but knew that it was a national task so we had to do our best,&quot; said Can, who did not tell his wife about the situation.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">&quot;Players&#39; strong determination and their iron mindset to play for Vietnam moved me. They got injuries, they were exhausted but they did not give up. We, the&nbsp;doctors, also fought hard,&quot; he said.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">He added that being a sports doctor is a glorious profession, because he&nbsp;often stands in the background, witnessing first-hand the great moments of victory. Doctors are not an important part of the tournament but not many people have the chance to see the national flag flying high and sing the national anthem together with winning athletes.</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">&quot;Our job is hard but the players work 10 times harder. They practised regardless of the weather, rain or shine. Looking at them, I find my job is nothing and love them more. I think I am lucky to have the chance to contribute my humble labour to the success of the team,&quot; said Trinh.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">&quot;On February 27,&nbsp;National Doctor&#39;s Day, I wish all the best for my colleagues, especially those who are sports doctors and physicians. I hope they will stand strong in the pandemic and contribute more to national sports. Happy&nbsp;National Doctor&#39;s Day!&quot; said Trinh, whose next task is to accompany the Vietnam Team at the 31st SEA Games this May in Hanoi.</span></span></span></span></span></p>', 'Doctor U23', 'VN', 1, 'sports-doctors-the-unsung-heroes-of-vietnam-s-success28.jpg', 3, '2022-09-08 18:17:31', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(18, 5, 'U23 Vietnam win international praise', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">The U23 team have written a new page in the history of Vietnamese football after winning a ticket to the quarterfinals of the Asian Football Confederation (AFC) U23 Championship in China on January 17.</span></span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The U23 team have written a new page in the history of Vietnamese football after winning a ticket to the quarterfinals of the Asian Football Confederation (AFC) U23 Championship in China on January 17.</span></span></span></em></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The accomplishment has received a lot of compliments from the international media.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The organiser AFC posted a story on its home page titled &ldquo;Draw takes Vietnam into quarter-finals&rdquo;.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">It quoted the team head coach Park Hang-seo as saying &quot;I want to thank my players, they played as a team today with an excellent spirit. We wanted to win (the match), but my players were physically tired, so our performance dropped a little. I made substitutions at the right time to fix this issue.&rdquo;</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Meanwhile, the Fox Sports Asia carried an article under the title &ldquo;AFC U-23 Championship: Brave Vietnam reach quarter-finals&rdquo; by journalist Gabriel Tan who wrote that a resolute display by Vietnam has seen them qualify for the knockout round of the 2018 AFC U-23 Championship with a 0-0 draw against Syria on January 17.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">&ldquo;Despite coming up against tremendous pressure from the Syrians at the Changshu Stadium, a heroic defensive showing by Vietnam was enough to earn a point,&rdquo; it wrote.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Thailand&rsquo;s Siam Sports described the achievement of the U23 Vietnam as a pride of the Association of Southeast Asian Nations (ASEAN).</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnam had a strong defense plan against a rival with outstanding physical strength, it said.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Thai version of Four Four Two newspaper also gave a lot of compliments to the U23 Vietnam, saying the team has made history with the second place in Group D after the Republic of Korea.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Thai Rath newspaper said Vietnam&rsquo;s young football has surpassed Thailand to become the locomotive of the Southeast Asian region.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">PM sends congratulations to U23 Vietnam</span></span></strong></span></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption><em>Football players from U23 Vietnam and U23 Syria</em></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Prime Minister Nguyen Xuan Phuc has congratulated the U23 Vietnam on their success at the Asian Football Confederation U23 Championship, going through to the quarter-finals.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnamese footballers drew their Syrian rivals in the last group match on January 17 in China, earning a slot in the quarterfinals of the tournament for the first time in history.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">With four points after three games, Vietnam ranked second behind the Republic of Korea and became one of the eight strongest teams in the continental competition.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">In his congratulatory letter, the Prime Minister said he was very glad to hear from the U23 Vietnam team. They gave good performance at the continental tournament to enter the quarterfinals for the first time, bringing pride to the nation, and showing the young Vietnamese generation&rsquo;s will.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">He praised the effort of head coach Park Hang-seo and the whole team. He hoped that they will continue shining in the next match.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Minister of Culture, Sports and Tourism Nguyen Ngoc Thien also sent a letter of congratulations to the U23 squad.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Minister announced a bonus of 200 million VND (9,000 USD) to the U23s. At the same time the Vietnam Football Federation also delivered a 1.4 billion VND (63,000 USD) bonus for their miracle in China.</span></span></span></span></span></p>', 'U23', 'U23', 1, 'hlv_chiatay379.jpg', 1, '2022-09-08 18:21:24', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(19, 5, 'U23 Vietnam to compete in Thailand', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">Vietnam&rsquo;s U23 team will compete in the international friendly football tournament the M-150 Cup 2017 in Thailand on December 9-15.</span></span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnam&rsquo;s U23 team will compete in the international friendly football tournament the M-150 Cup 2017 in Thailand on December 9-15.</span></span></span></em></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The event will feature six U23 teams from Myanmar, Uzbekistan, North Korea, Thailand, Japan and Vietnam.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnam are in Group B alongside Thailand and Myanmar, while Group A consists of Japan, North Korea and Uzbekistan. They will compete in a round robin format. The top two teams will advance to the final.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The winner will walk away with US$20,000.</span></span></span></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"600\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnam will meet the hosts Thailand on December 9 at I-Mobile stadium in Buriram in their opening game.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">In other news, the Vietnam Football Federation will officially sign a contract with coach Park Hang-seo of South Korea tomorrow. He will take charge of the national team and the U23s.&nbsp;</span></span></span></span></span></p>', 'Thailand VN', 'Thailand VN', 1, '20171010102810-270.jpg', 2, '2022-09-08 18:25:50', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(20, 5, 'VN drawn against Myanmar for AFC U23 qualifiers', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">Vietnam&nbsp;will play fellow Southeast Asian side&nbsp;Myanmar&nbsp;in the qualifiers for the 2022 AFC U23 Asian Cup.</span></span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">At the draw held by the Asian Football Confederation (AFC) on Friday, coach Park Hang-seo&#39;s men were placed in Group I to battle it out&nbsp;for a spot in the&nbsp;tournament, in Uzbekistan, in June next year.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">They will also take on&nbsp;</span></span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Hong Kong and Chinese Taipei.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Matches are slated to be held this October in centralised venues&nbsp;where each team will play each other once. Việt Nam&#39;s matches will be hosted in Taipei.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The 11 group winners and four best runners-up will qualify for the tournament.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Vietnamese side will be seen as favourites to qualify, having been seeded in pot 1 for the draw and having performed considerably better than their opponents in recent years.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Việt Nam struggled in the last edition of the tournament in early 2020 in Thailand, finishing bottom of their group with two draws and a defeat to North Korea.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The 2018 tournament, however, was perhaps Vietnamese football&#39;s finest moment.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The unfancied Vietnamese made it all the way to the final, knocking out Asian football heavyweights like Australia, Iraq and Qatar along the way.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">They narrowly lost the final 2-1 to Uzbekistan after extra time in snowy Changzhou City, China.</span></span></span></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"564\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The silver medal was and remains Việt Nam&#39;s greatest achievement in an AFC tournament and helped kick-start all the remarkable success the senior and junior national teams have enjoyed in the last three years.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">With only players born on or after January 1, 1999, eligible to play in the qualification campaign and finals, only six members of the 2020 squad that played in Thailand will be up for selection.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">In related news, senior and U23 team head coach Park Hang-seo returned to his native South Korea on Friday evening following the death of his father-in-law.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">V.League restart postponed</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Hopes for restarting the domestic football season took another blow on Thursday, as the Việt Nam Professional Football (VPF) Company announced it had scrapped plans to resume play this month.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The VPF had hoped to hold the final seven fixtures of the first half of the season on July 31 and wrap up the second half in August, with all matches in the second half taking place in the north.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">However, due to the continued uptick in COVID-19 cases, particularly the large outbreak in HCM City, the VPF told clubs the planned restart was no longer under consideration.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">No alternative date for the restart has been announced, while the national team are scheduled to gather in a training camp in August to prepare for World Cup qualifying&nbsp;fixtures starting in September.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Play was halted in early May at the beginning of the fourth wave of COVID-19 infection</span></span></span></span></span></p>', 'Vietnam', 'U23', 1, '162535_snow 201854.jpg', 4, '2022-09-08 18:32:55', NULL);
INSERT INTO `tbl_post` (`post_id`, `cate_post_id`, `post_title`, `post_content`, `post_meta_desc`, `post_meta_keywords`, `post_status`, `post_thumbnail`, `post_view`, `created_at`, `updated_at`) VALUES
(21, 4, 'Vietnam arrives in Thailand for AFC U23 Championships', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#404040\">The Vietnam U23 football team has arrived in Thailand to prepare for the 2020 AFC U23 Championships.</span></span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The Vietnamese players held a training session today, January 2 and tomorrow will play a friendly match with Bahrain&rsquo; U23s.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Coach Park Hang Seo said that this is an important tournament, so the squad would try their best.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">On January 6, the Vietnamese team are set to travel to Buriram Province for clashes against UAE on January 11 and Jordan on January 13. They will meet North Korea on January 16 in Bangkok.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">Vietnam won the silver medal at the 2018 AFC U23 Championships held in China.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The 2020 AFC U23 Championship is set to take place from January 8 to 26 across four stadiums in Thailand, with the participation of 16 teams.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"680\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em>Vietnam are in Group D together with the United Arab Emirates, Jordan and North Korea.</em></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#505050\">The continental championship also serves as a qualification event for the 2020 Tokyo Olympics, with the four best teams qualifying as AFC representatives.</span></span></span></span></span></p>', 'VIETNAM', 'AFC', 1, 'vietnam-arrives-in-thailand-for-afc-u23-championships74.jpg', 4, '2022-09-08 18:38:48', NULL);
